import React from "react";
import styled from 'styled-components';
import Sidebar from "../Components/Sidebar";

const MakemainPositioner = styled.div`
  border-style: solid;
`;

function Myspace() {
  return (
    <MakemainPositioner>
      <Sidebar />
      
    </MakemainPositioner>
  );
}

export default Myspace;
